import React, { Component } from 'react'

class Header extends Component {
    render(){
        return(
            <div>
                <span id = 'headerName'>Matthew Abrey</span>
                <button id = 'hamburgerMenu'>Expand button</button>
            </div>
        );
    }
}
export default Header
